import cl from '../styles/Addqn.module.css'
import { useState } from 'react';

const AddQuickNote = (props) =>{
    const [quickNoteText,setQuickNoteText] = useState('');
    return(<>
        <input className={cl.AddqnInput} value={props.quickNoteText} onChange={e=>{props.setQuickNoteText(e.target.value)}}></input>
        <button className={cl.AddqnBut} onClick={()=>props.createQuickNote(quickNoteText)}>{props.children}</button>
    </>)
}

export default AddQuickNote
